import React from 'react';
import { BrowserRouter, Route, Switch} from 'react-router-dom';

import Home from './components/Home';


function App() {

  return (
    <>
      <BrowserRouter basename='/code-land/'>
        <Switch>
          <Route
            path="/"
            exact
            component={Home}
          />
          {/* <Route component={NotFoundPage} /> */}
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
